import React from 'react'
import { Link } from 'react-router-dom';

const Favourites = () => {
    
    //var cust_Name=sessionStorage.getItem("cust_name");
    var favDetails=[];
    
        const url="http://localhost:3002/getfav";
        Axios.post(url,{
            cust_name:sessionStorage.getItem("cust_name")
        }).then((response)=>{
            favDetails.push(response.data);
        })
    

    
    return (
        <div>
            <h2>Recently added....</h2>
            {favDetails.map((val)=>{
                            return (
                                <div >
                                    
                                    <img src={val.Rest_Image} />
                                    <h3><strong>Name : </strong>
                                    <Link  to={{
                                            pathname: "/viewrestro",
                                            state:{val}
                                            }}><strong>{val.Rest_Name}</strong></Link>
                                    </h3>
                                    
                                    <br></br>
                                    </div>
             ) })}

            
        </div>
    )
}



export default Favourites
